import '../styles/Header.css';
import { Link } from 'react-router-dom'

export default function Header() {
    return(
        <header>
            <h1 className='logo'>RiskPRFM</h1>
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>FAQs</li>
                <li>Contact</li>
            </ul>
        </header>
    )
}
